  are proprietary funds used to record activity (primarily goods and services) provided
  by one department to other departments of the County government on a cost-reimbursable
  basis.  The County uses this type of fund to account for Motor Pool, Central Duplicating,
  Liability and Property Coverage Self-Insurance, and Employee Health Benefits Self-Insurance.rnrnUpdate
